import React, {useEffect} from 'react';
import './PokemonCard.css'



const pokeCard = () =>{
    useEffect(()=>{
        const url = 'https://pokeapi.co/api/v2/pokemon/3'
        fetch(url)
        .then(res=>res.json())
        .then(data => console.log(data))
        .catch(err => console.log(err));
    }, [])
    return (
        <div className='pokemones'>
            <h1>HOLA</h1>
        </div>
    )
}
export default pokeCard
